        if lst[i] > lst[i + 1]:
            return False
    return True

def two_unique_nums(lst):
    counts = {}
    for num in lst:
        counts[num] = counts.get(num, 0) + 1
    duplicates = [k for k, v in counts.items() if v == 2]
    return duplicates[:2]  # or just return duplicates if there are exactly two

def unique_product(lst):
    unique_nums = set(lst)
    product = 1
    for num in unique_nums:
        product *= num
    return product

def is_Sub_Array(lst, lst2, n, n2):
    # Check for edge cases
    if n2 == 0:
        return True
    if n == 0 or n2 > n:
        return False

    # Check each possible starting position in lst
    for i in range(n - n2 + 1):
        match = True
        for j in range(n2):
            if lst[i + j] != lst2[j]:
                match = False
                break
        if match:
            return True
    return False

def last_Digit_Factorial(n):
    if n == 0:
        return 1
    elif n == 1:
        return 1
    elif n == 2:
        return 2
    elif n == 3:
        return 6
    elif n == 4:
        return 4
    else:
        return 0

def interleave_lists(lst, lst2, lst3):
    if len(lst) != len(lst2) or len(lst) != len(lst3):
        raise ValueError("All lists must have the same length.")
    result = []
    for i in range(len(lst)):
        result.append(lst[i])
        result.append(lst2[i])
        result.append(lst3[i])
    return result

def find_dissimilar(tup, tup2):
    set1 = set(tup)
    set2 = set(tup2)
    return tuple(set1.symmetric_difference(set2))

def extract_even(tup):
    result = []
    for element in tup:
        if isinstance(element, tuple):
            result.extend(extract_even(element))
        else:
            if element % 2 == 0:
                result.append(element)
    return result

def perfect_squares(n, n2):
    # Determine the start and end of the range
    start = min(n, n2)
    end = max(n, n2)
    perfect_squares_list = []
    # Iterate through each number in the range
    for num in range(start, end + 1):
        # Check if the number is a perfect square
        root = int(num ** 0.5)
        if root * root == num:
            perfect_squares_list.append(num)
    return perfect_squares_list

def polar_rect(n, n2):
    x = n * math.cos(n2)
    y = n * math.sin(n2)
    return (x, y)

def swap_List(lst):
    if len(lst) < 2:
        return lst
    lst[0], lst[-1] = lst[-1], lst[0]
    return lst

def sum_Of_product(n):
    total = 0
    for k in range(n + 1):
        product = 1
        for i in range(k + 1):
            product *= math.comb(k, i)
        total += product
    return total

def removezero_ip(s):
    parts = s.split('.')
    processed = []
    for part in parts:
        stripped = part.lstrip('0')
        if stripped == '':  # if the part was all zeros
            processed.append('0')
        else:
            processed.append(stripped)
    return '.'.join(processed)

def diff_even_odd(lst):
    first_even = None
    first_odd = None
    for num in lst:
        if num % 2 == 0:
            if first_even is None:
                first_even = num
        else:
            if first_odd is None:
                first_odd = num
    return first_even - first_odd

